import React from 'react';
import "./Checkout.css";

function Checkout() {
  return (
    <div className="Checkout">
      <div className="Checkout__left">
        <img
          className="https://images-na.ssl-images-amazon.com/images/G/02/UK_CCMP/TM/OCC_Amazon1._CB423492668_.jpg"
          alt=""
        />
      </div>
    </div>
  );
}

export default Checkout
